ara o ovo terminar de fritar mas a gema ainda ficar mole – o vapor permite que a clara cozinhe por igual sem a base do ovo queimar. Sirva a seguir.','Um clássico simples e rápido: ovo frito com gema macia e clara crocante, ideal para qualquer refeição.',15,NULL),(4,'Bolo de Chocolate','Misture os ingredientes secos, adicione os líquidos e leve ao forno por 40 minutos.','Bolo caseiro de chocolate fofinho e úmido, perfeito para acompanhar um café da tarde.',15,NULL),(5,'Panqueca de Aveia','Misture todos os ingredientes e cozinhe em fogo baixo até dourar.','Panqueca nutritiva feita com aveia, ideal para um café da manhã saudável e delicioso.',15,NULL),(6,'Salada de Frutas','Corte as frutas e misture com o suco de laranja.','Salada colorida e refrescante, cheia de frutas variadas, perfeita para um lanche ou sobremesa leve.',15,NULL),(7,'Sopa de Legumes','Cozinhe todos os ingredientes até ficarem macios.','Sopa nutritiva e reconfortante, cheia de legumes frescos, ideal para dias mais frios.',15,NULL),(8,'Bolo de Chocolate','Misture os ingredientes secos, adicione os líquidos e leve ao forno por 40 minutos.','Bolo caseiro de chocolate fofinho e úmido, perfeito para acompanhar um café da tarde.',15,NULL),(17,'Teste dos ing','aaaaaaaaaaaaaaaaaaaaaa','ssssssssssssssss',16,_binary 'RIFFr\\0WEBPVP8 f\\00	*>m2H$\"\rc-\ϥ\08\/a\\\<\\\q\ vn4p\\sgΊ\\\\@y\O~/G|uvݏ\/>ſ?=}	gy}tEKOGϖy\\wK\Z\\sL \\\>߭`?\\'aޛ~fﱨ\e\[h\j5\Z\r.ޞ\S:9\xF\ƺ#?~?\c\\M½\8\K^_W(hpmjM\C	jvS\fY\k53\fVE֛\d\Z\\t\1\nϥ\\0e\$<R{(ze\lє\YWTYpʁ\(w<%Ux[{yW813.r<\ s\2=Cpax\eg\Ͷ pR&N 9L\!#\k\N\2{t=,\\Jd͆P\\z`\0\Sg2ɲ^ؖ\\\{\َTFlн\j[\HJ\\\Tw1u*ϭyA?OoqIɛ6z͋\\rJ:d\MhP96\"\W|\n1K\l\\"\Z=޿\܇Lbކ%\\ѯO\Bĉ\\C\\+_#\ФE`\6M\z\roeQ\`X	\	qDy`\\b\h=\rb\\P0?DyA\"|L\vPg\h6cj\y\\Z\\\\:S_ΤALA\=\rW\\\M\\\f(\w\#*5X<d*ٷMy)0x.\=[\(m\	8~nt\Z=\Jv?MaO\U\\,W46F.Md\WO\k\!\9[\0$vH\*\\i\-DOj6\}74a]ԇߌ\|aPe8y\^dR\'58;\rI\J\(n>H\\zP~^!dI\\\8~FD	\&\Ng\S